"   <a class=\"licenseLink\" href=\"./license\" id=\"sla_in_page\" target=\"_blank\">",
"    Subscription and License Agreement",
"   </a>",
"   .",
"  </div>",
"  <div class=\"headingAnchor\" id=\"references\">",
"   <h1>",
"    REFERENCES",
"   </h1>",
"   <ol id=\"reference\">",
"    <li>",
"     <div class=\"reference\">",
"      Olkkola KT, Hamunen K, and Maunuksela EL, &ldquo;Clinical Pharmacokinetics and Pharmacodynamics of Opioid Analgesics in Infants and Children,&rdquo;",
"      <i>",
"       Clin Pharmacokinet",
"      </i>",
"      , 1995, 28(5):385-404.",
"      <span class=\"pubmed-id\">",
"       [PubMed",
