"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        Emphysema in a young individual (ie, less than or equal to 45 years)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Emphysema in a nonsmoker or minimal smoker",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Emphysema characterized by predominant basilar changes on the chest x-ray",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        A family history of emphysema and/or liver disease, especially unexplained cirrhosis or hepatoma",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Clinical findings or history of panniculitis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Clinical findings or history of unexplained chronic liver disease",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
